import React, { useEffect, useState } from "react";
import ReactDOM from "react-dom";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  withRouter
} from "react-router-dom";
import {
  Posts,
  AccountForm,
  Home,
  Login,
  NewPost,
  Messages
} from "./Components/index.js";
import { Link } from '@material-ui/core';
import "./style.css";

const baseURL = "https://strangers-things.herokuapp.com/api/2105-SJS-RM-WEB-PT";

const App = () => {
  const [token, setToken] = useState("");
  const [login, setLogin] = useState(false);
  const [user, setUser] = useState({})
  // const [postId, setPostId] = usestate(null)
  console.log(token);
  console.log('user: ', user)
  return (
    <div id="content">
      <center>
      <Link href="/">Home</Link> | <Link href="/newpost">New Post</Link> |{" "}
      <Link href="/posts">Posts</Link> |{" "}
      <Link href="/account/register">Register</Link> |{" "}
      <Link href="/profile">Profile</Link> |{" "} 
      {token ? (
        <Link
          onClick={() => {
            setToken("");
            setLogin(false);
          }}
        >
          Log out
        </Link>
      ) : (
        <Link href="/account/login" variant="contained" color="primary">Login</Link>
      )}
      <Route exact path="/">
        <Home user={user} token={token} />
      </Route>
      <Route path="/posts">
        <Posts user={user} token={token} />
      </Route>
      <Route path="/account/:method">
        <Login setUser={setUser} />
      </Route>
      <Route exact path="/account/:method">
        <AccountForm setToken={setToken} setUser={setUser} user={user} />
      </Route>
      <Route path="/newpost">
        <NewPost token={token} />
      </Route>
      <Route path="/profile">
        <Messages token={token} user={user} />
      </Route>
      </center>
    </div>
  );
};

ReactDOM.render(
  <Router>
    <App />,
  </Router>,
  document.getElementById("app")
);
